  false,\n\t\"url\": null,\n\t\"notes\": \"The Airports database (NTAD 2015) is a
  geographic point database of aircraft landing facilities in the United States and
  U.S. Territories. Attribute data is provided on the physical and operational characteristics
  of the landing facility, current usage including enplanements and aircraft operations,
  congestion levels and usage categories. This geospatial data is derived from the
  FAA's National Airspace System Resource Aeronautical Data Product.\",\n\t\"license_title\":
